import React from "react";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import bootstrap from "bootstrap/dist/css/bootstrap.min.css";
import bookingservice from "../services/bookingservice";
import AuthService from "../services/auth.service";
let p = localStorage.getItem("username");
let t = localStorage.getItem("train_name");

let tn = localStorage.getItem("train_no");
let fn = localStorage.getItem("fname");
let ln = localStorage.getItem("lname");

const Fullticket = () => {
  const [user, setFaculty] = useState([]);
  const [ticket, setTicket] = useState([]);
  const [booking, setBooking] = useState([]);
  const init = () => {
    AuthService.getUser(p)
      .then((response) => {
        console.log("Printing faculty data", response.data);
        setFaculty(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
  useEffect(() => {
    init();
  }, []);
  const fullBooking = () => {
    bookingservice
      .fullticket(user.emailId)
      .then((response) => {
        console.log("Printing Ticket data", response.data);
        setBooking(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
  useEffect(() => {
    fullBooking();
  }, []);

  return (
    <div>
      <div>
        <p> Name:{p}</p>
      </div>
      <div>
        <p>
            Train No:
        </p>
      </div>
    </div>
  );
};

export default Fullticket;
